function X = RobotSystem(t,x,u)
q1 = x(1); dotq1 = x(2); q2 = x(3); dotq2 = x(4); tau1 = u(1); tau2 = u(2);
X(1) = dotq1;
X(2) = (3700.*(5.*cos(q1 + q2) + 15.*cos(q1) - dotq2.*((dotq1.*sin(q2))./2 + (dotq2.*sin(q2))./2) - (dotq1.*dotq2.*sin(q2))./2))./(2500.*cos(q2).^2 - 5069) - (3700.*tau1)./(2500.*cos(q2).^2 - 5069) - (100.*(5.*cos(q1 + q2) + (dotq1.^2.*sin(q2))./2).*(50.*cos(q2) + 37))./(2500.*cos(q2).^2 - 5069) + (100.*tau2.*(50.*cos(q2) + 37))./(2500.*cos(q2).^2 - 5069);
X(3) = dotq2;
X(4) = (200.*(5.*cos(q1 + q2) + (dotq1.^2.*sin(q2))./2).*(50.*cos(q2) + 87))./(2500.*cos(q2).^2 - 5069) - (100.*(50.*cos(q2) + 37).*(5.*cos(q1 + q2) + 15.*cos(q1) - dotq2.*((dotq1.*sin(q2))./2 + (dotq2.*sin(q2))./2) - (dotq1.*dotq2.*sin(q2))./2))./(2500.*cos(q2).^2 - 5069) + (100.*tau1.*(50.*cos(q2) + 37))./(2500.*cos(q2).^2 - 5069) - (200.*tau2.*(50.*cos(q2) + 87))./(2500.*cos(q2).^2 - 5069);
X = X';
